import React from 'react';
import Member from './members/Member';

function Teammember() {
  return (
      <div className=''>
            <div className='navbar bg-dark text-white shadow-lg p-3 mb-5'>
                <h1>Our Member</h1>
            </div>
            <div className='container row'>
                <Member name = 'Hesham' img= 'images\img_avatar-01.png'/>
                <Member name = 'Abeer' img= 'images\img_avatar-01.png'/>
                <Member name = 'Aseel' img= 'images\img_avatar-01.png'/>
                <Member name = 'Haytham' img= 'images\img_avatar-01.png'/>
            </div>
      </div>
  )
}

export default Teammember;
